6	Anubis	Egyptian	Mage	492 (+72)	338 (+58)	360 (+0)	Magical	0.87 (+0.99%)	Ninguna	13 (+2.5)	25 (+1.3)	7.45 (+0.45)	5.16 (+0.36)	Anubis, el dios con cabeza de chacal, tiene el juicio definitivo sobre los muertos, midiendo cada coraz├│n contra el peso de la Verdad.\r\n\r\nNephthys, esposa de Set, el Dios de la Oscuridad, deseaba tener un hijo, pero su marido era est├®ril, as├¡ que Nephthys se disfraz├│ de Eset, la esposa de Osiris, hermano de Set, y lo sedujo. De esa uni├│n naci├│ Anubis. Osiris cuid├│ de Anubis como si fuera su propio hijo, pero cuando Osiris fue asesinado por su malvado hermano, Set, Anubis embalsam├│ a su padre adoptivo y momific├│ el cad├íver para que no se descompusiera. Esta preservaci├│n pas├│ a los fieles, pues si era lo suficientemente buena para los Dioses, era lo suficientemente buena para los hombres.\r\n\r\nNadie entra en el abismo del Inframundo sin ser antes probado por Anubis. Cuando los cad├íveres son preservados, ├®l es el embalsamador. Cuando llega el momento del juicio, ├®l es el ├írbitro final. En su reino, mantiene legendarias balanzas de pesaje. De un lado, el peso masivo de Ma'at ÔÇö la verdad y el orden. Del otro lado, coloca el coraz├│n del difunto. Si el peso de Ma'at resulta infinitamente m├ís pesado que el del coraz├│n, Anubis arroja el alma profundamente en la oscuridad del Inframundo, donde se olvida, sin posibilidad de renacer.	gods/SkinArt_Anubis_Default.webp	Easy	37 (+1.5)
4	Thor	Norse	Assassin	536 (+76)	278 (+38)	370 (+0)	Physical	1.01 (+1.45%)	Ninguna	17 (+2.9)	25 (+1.3)	9.69 (+0.69)	4.69 (+0.29)	Thor, tan famoso como audaz, es el Dios del cielo tronante. Sin embargo, su martillo, Mjolnir, es casi tan famoso como ├®l, y Thor no permitir├í que se lo arrebaten.\r\n\r\nOdin, el Padre de Todos, tuvo muchos hijos, pero ninguno tan conocido ni tan poderoso como Thor, quien pose├¡a la fuerza para mover monta├▒as y el poder para llamar los rayos del cielo. A pesar de estos dones incre├¡bles, los enemigos de Thor eran astutos, sedientos de sangre y numerosos. Los Gigantes de Hielo amenazaban constantemente con invadir Asgard, lo que requer├¡a toda la fuerza casi ilimitada de Thor solo para mantenerlos a raya. Si realmente el rumbo de la batalla se hubiera invertido, Asgard podr├¡a haber sido destruido, pero una simple broma de Loki, el traicionero, termin├│ con la creaci├│n de Mjolnir, el martillo legendario, y con ├®l, Thor aplast├│ por completo a los Gigantes de Hielo.\r\n\r\nSif, la esposa de Thor, ten├¡a un cabello como los rayos del sol a trav├®s de un cielo nublado, y Loki, siendo codicioso, secretamente lo cort├│ mientras ella dorm├¡a. Lleno de furia, Thor exigi├│ que Loki solucionara el problema. As├¡ que Loki fue a los enanos de Ivaldi, quienes forjaron una corona dorada que hac├¡a crecer cabello igualmente dorado, una lanza que nunca fallaba y un barco que nunca se hund├¡a. Orgulloso de sus tesoros, Loki regres├│ con Thor y los dem├ís Dioses, entreg├│ la corona a Sif y luego se jact├│ de que no se pod├¡an forjar objetos mejores.\r\n\r\nEl enano Brokk se ofendi├│ por esto y afirm├│ que ├®l y su hermano pod├¡an hacer algo mejor. Loki apost├│ su cabeza a que no lo lograr├¡an. Entonces, Brokk y su hermano forjaron tres objetos: un anillo que creaba un duplicado cada nueve d├¡as, un cerdo dorado que pod├¡a volar y nadar, y el martillo, Mjolnir, con el poder de destrozar monta├▒as. Mientras cada objeto era forjado, Brokk era mordido ferozmente por una mosca, pero solo al tercero se movi├│, lo que caus├│ que el martillo tuviera un mango m├ís corto. Cuando terminaron, los enanos llevaron sus artefactos ante los Dioses y denunciaron el disfraz de mosca de Loki. Todos los Dioses estuvieron de acuerdo en que Brokk y su hermano hab├¡an forjado objetos superiores. Loki, siempre astuto, declar├│ que su cuello no formaba parte de la apuesta, neg├índoles su cabeza.\r\n\r\nMjolnir fue para Thor para luchar contra los Gigantes de Hielo. Orgulloso y poderoso, Thor rechaz├│ a la horda malvada y contin├║a defendiendo Asgard hasta el d├¡a de hoy. Con Mjolnir en mano, Thor es una fuerza imparable que incluso otros Dioses har├¡an bien en evitar.	gods/SkinArt_Thor_Default.webp	Hard	41 (+2.4)
1	Afrodita	Greek	Mage	448 +(68)	283 (+43)	355 (+0)	Magical	0.88 (+0.95%)	Ninguna	12 (+2.7)	25 (+1.3)	6.45 (0.45)	5.21 (+0.41)	Hay muy pocas palabras para describir el resplandor, la magnificencia, la gloria incomparable de Afrodita, la Diosa de la Belleza. Tan maravillosa es su presencia que una sola mirada puede inspirar l├ígrimas, deseo, celos y amor. Sin embargo, bajo su impecable exterior, reside un coraz├│n cargado de inseguridad.\r\n\r\nDesatento y de apariencia repulsiva, su esposo Hefesto, sin saberlo, deja a Afrodita sinti├®ndose sola y sin valor. Encuentra consuelo en los brazos de otros hombres, como Ares, o validaci├│n al competir en cualquier concurso de belleza que se le presente.\r\n\r\nEn una boda a la que asistieron todos los dioses, apareci├│ una manzana dorada con la inscripci├│n "para la m├ís hermosa". Inmediatamente, Afrodita, su madre Hera y su hermana Atenea discutieron por ella. Zeus eligi├│ a Paris, pr├¡ncipe de Troya, para que decidiera una ganadora. A cambio de ser nombrada la m├ís hermosa, Afrodita le ofreci├│ a cualquier mujer del mundo como esposa, y Paris acept├│. Sin embargo, eligi├│ a Helena como su esposa, y su amor dio inicio a la catastr├│fica Guerra de Troya.\r\n\r\nAhora, una nueva guerra se avecina, pero esta vez entre dioses, no entre hombres. Aunque el campo de batalla no es lugar para la m├ís hermosa de todas, Afrodita recuerda la destrucci├│n entre griegos y troyanos. Tal vez, esta vez, su belleza pueda ser usada para detener una guerra en lugar de iniciarla. Tal vez, esta vez, descubra la belleza que reside en su interior.	gods/SkinArt_Aphrodite_Default.webp	Hard	33 (+1.45)
