uria impredecible de su patr├│n y atan sus estatuas con cadenas. Esto es, en parte, para evitar que el esp├¡ritu de victoria de Ares escape de Esparta, y un esfuerzo vano por mantener al Dios de la Guerra contenido.	gods/SkinArt_Ares_Default.webp	Easy	44 (+4)
