2	Arena	Este es un modo de juego de muerte por equipos 5vs5 que tiene lugar en una peque├▒a arena. Los jugadores pueden unirse a este modo de juego desde el nivel 1 de su cuenta.\r\n\r\nEste mapa no tiene carriles ni torres y no hay Titanes que derrotar. En su lugar, cada equipo tiene un contador de boletos con 500 boletos. El objetivo en Arena es reducir el contador de boletos del equipo enemigo a 0. Los jugadores pueden lograr esto mediante:\r\n\r\nMatar a un Dios enemigo, lo que deduce 5 boletos.\r\nDar el ├║ltimo golpe o asistir en la muerte de un minion enemigo, lo que deduce 1 boleto (los minions que se maten entre ellos sin la intervenci├│n de dioses no deducir├ín boletos).\r\nAcompa├▒ar a los minions aliados hasta el portal enemigo frente a su base, lo que deduce 1 boleto por cada minion.\r\nAcompa├▒ar a un Minotauro aliado hasta el portal enemigo, lo que deduce 15 boletos.\r\nLos minions aparecen en los lados izquierdo y derecho de cada base y marchan por los caminos de tierra hacia el centro de la arena. Si no hay minions ni dioses enemigos que los ataquen, se dirigir├ín directamente al centro de la base enemiga, donde se encuentra un portal. Los minions que lleguen al portal hacen que el enemigo pierda boletos. Los minions aparecen en oleadas de siete cada 20 segundos, alternando entre los puntos de aparici├│n. Adem├ís, los objetos Starter EyeoftheJungle T1 Eye of the Jungle, sus mejoras y EmperorsArmor T3 Emperor's Armor est├ín deshabilitados en este modo de juego.\r\n\r\nUn superminion especial, el Minotauro, aparecer├í cada vez que un equipo consiga 10 muertes. El Minotauro tiene una gran cantidad de vida y ataques cuerpo a cuerpo fuertes. Los Minotauros se mover├ín junto con las oleadas de minions regulares, ignorando a los minions enemigos, pero se detendr├ín si un dios enemigo est├í cerca. Comenzar├ín a atacar a los jugadores solo si se interponen en su camino, enfoc├índose en ellos hasta que el objetivo muera o otro jugador enemigo se acerque. Los Minotauros ignorar├ín a los jugadores enemigos y avanzar├ín si un dios aliado est├í cerca.\r\n\r\nHay dos salidas en cada base, ubicadas en los extremos izquierdo y derecho. Hay un F├®nix invulnerable protegiendo cada entrada. Tambi├®n hay campamentos neutrales de buff en los lados izquierdo y derecho de la arena.\r\n\r\nLos equipos respawnean en oleadas en este modo. Hay un solo temporizador para todo el equipo que est├í constantemente en cuenta regresiva. Por lo tanto, si un jugador muere justo antes de que termine el temporizador del equipo, resucitar├í casi de inmediato. El temporizador del equipo aumenta en duraci├│n cuanto m├ís adelante est├® ese equipo en la puntuaci├│n, hasta un m├íximo de 60 segundos.\r\n\r\nUna vez que un equipo llegue a 10 boletos, matar minions est├índar (Cuerpo a cuerpo y Arqueros) ya no deducir├í boletos. Matar minions Brute y acompa├▒ar a los minions aliados a trav├®s del portal enemigo seguir├í deduciendo boletos.	modes/Queue_Arena.webp	minimaps/UnderworldArenaV108_Minimap.webp	En Arena, dos equipos de cinco jugadores se enfrentan en una peque├▒a arena sin carriles ni torres. No hay Titanes en este modo. En su lugar, el objetivo de los jugadores es reducir el contador de boletos del equipo enemigo a 0. Cada equipo comienza con 500 boletos y existen reglas espec├¡ficas para reducir los boletos enemigos.\r\n\r\nHay dos salidas en cada base, ubicadas en los lados m├ís a la izquierda y m├ís a la derecha. Hay un F├®nix invulnerable protegiendo cada entrada. Tambi├®n hay campamentos neutrales de buff en los lados izquierdo y derecho de la arena.	{"oro_inicial": 1500, "generacion_xp": "11 por segundo", "nivel_inicial": 3, "tiempo_jungla": "0:00", "generacion_oro": "11 por segundo", "tiempo_minions": "0:00", "jugadores_equipo": 5, "tiempo_preparacion": "1:00"}	
1	Conquista	Dos equipos de cinco jugadores se enfrentan en un mapa de tres carriles. Los jugadores pueden unirse a este modo de juego desde el nivel 1 de su cuenta.\r\n\r\nEste es un modo MOBA t├¡pico, con dos bases en lados opuestos del mapa conectadas por tres carriles. Cada carril est├í protegido por dos torres y un F├®nix. Entre estos carriles est├í la jungla, que es un laberinto que conecta los carriles y contiene varios campamentos de monstruos neutrales que otorgan diferentes mejoras y bonificaciones al jugador que los derrota.\r\n\r\nEl objetivo principal de este modo es que los jugadores asalten las defensas enemigas y destruyan el Tit├ín en el centro de su base, mientras evitan que el enemigo destruya el suyo. El primer equipo en destruir el Tit├ín enemigo gana.\r\n\r\nEl juego comienza despu├®s de un breve tiempo de configuraci├│n, donde los jugadores pueden gastar su oro inicial y recorrer el mapa para colocar guardianes o enfrentar a los dioses enemigos. No hay minions en los carriles ni monstruos de jungla durante este tiempo de configuraci├│n. Los minions de los carriles aparecen en cada carril despu├®s de este tiempo de configuraci├│n.\r\n\r\nPara avanzar y derrotar al Tit├ín enemigo, los jugadores deben destruir todas las estructuras de al menos un carril. Todas las estructuras de cada carril son invulnerables hasta que se destruye la m├ís alejada de la base. El Tit├ín no puede ser atacado hasta que al menos un F├®nix haya ca├¡do, y es m├ís fuerte mientras m├ís estructuras queden defendiendo.\r\n\r\nEl mapa de Conquista tiene un tema Grecorromano, que recuerda a los mapas anteriores, combinando espec├¡ficamente el mapa de la Open Beta y el mapa de la Temporada 2 de Conquista.	modes/Queue_Conquest_S9.webp	minimaps/ConquestV11_Minimap.webp	En Conquista, dos equipos de cinco jugadores se enfrentan en un mapa de tres carriles.\r\nEste es un modo MOBA t├¡pico, con dos bases en lados opuestos del mapa conectadas por tres carriles. Cada carril est├í protegido por dos torres y un F├®nix.\r\nEl objetivo principal de este modo es que los jugadores asalten las defensas enemigas y destruyan el Tit├ín en el centro de su base, mientras evitan que el enemigo destruya el suyo. El primer equipo en destruir el Tit├ín enemigo gana.\r\nPara obtener m├ís informaci├│n detallada sobre este modo de juego, visita su art├¡culo principal: Conquista.	{"oro_inicial": 1500, "generacion_xp": "Ninguna", "nivel_inicial": 1, "tiempo_jungla": "0:20", "generacion_oro": "3 por segundo", "tiempo_minions": "0:00", "jugadores_equipo": 5, "tiempo_preparacion": "1:50"}	Puertas de la Base: Hay cuatro de estas, dos en cada base de los equipos, ubicadas en las paredes entre los f├®nixes. Funcionan como paredes de jungla cuando est├ín cerradas y como caminos de jungla cuando est├ín abiertas. En el caso de las habilidades, funcionan como paredes creadas por los jugadores. Estas puertas se pueden abrir inmediatamente al estar en el ├írea dentro de la base, frente a la puerta.\r\n\r\nCampamentos de Cham├ín: Hay dos de estos, ambos en el lugar donde normalmente aparecen las Harp├¡as del Fondo. Aparecen 60 segundos despu├®s de que los jugadores limpien el campamento (el mismo tiempo en que las Harp├¡as del Fondo respawnean) y duran hasta los siguientes 5 respawn (2 minutos (120 segundos de respawn)) antes de volver a las Harp├¡as del Fondo. Est├í compuesto por un l├¡der Cham├ín y dos guardias Cham├ín, y cuando el l├¡der es derrotado, los T├│tems Espirituales se activan, otorgando a los jugadores diferentes bonificaciones a sus mejoras antes de obtenerlo y tiene una duraci├│n de 120s.\r\n          Esp├¡ritu Azul: +10/12.5/15% Reducci├│n de Tiempo de Recarga\r\n          Esp├¡ritu Dorado: +3/5/7 Penetraci├│n plana y +5% Penetraci├│n\r\n          Esp├¡ritu Violeta: +10/12.5/15% Velocidad de Ataque\r\n          Esp├¡ritu Carmes├¡: +12.5/15/17.5% Robo de Vida F├¡sico/Habilidad\r\n          Esp├¡ritu Verde: +10/12/14% Salud/Mana\r\n\r\nBastiones de Torre: Hay doce de estos, seis por lado, y dos por carril, dentro del radio de la Torre de Nivel 1. Mientras est├®n activos, proporcionan una mitigaci├│n de da├▒o del 25% cada uno (50% en total por Torre de Nivel 1), tienen una reducci├│n del 90% de curaci├│n y pueden ser da├▒ados por Ataques B├ísicos o Habilidades de los jugadores. Los Bastiones recompensan a los jugadores con 50 de oro y tienen las siguientes estad├¡sticas:\r\n          1000 de salud\r\n          60 de Protecci├│n F├¡sica\r\n          45 de Protecci├│n M├ígica\r\n          Recompensa en oro: 100 (200 en total)\r\n\r\nEfigie: Hay una de estas, dentro del campamento del Gigante de Fuego, que aparece cuando el Gigante de Fuego llega al 85% de salud, puede ser da├▒ada tanto por Ataques B├ísicos como por Habilidades, y cuando se destruye, el Gigante de Fuego recibe un 15% de da├▒o aumentado de todas las fuentes durante 15s.\r\n          600 de Salud\r\n\r\nFaro Estigio: Hay uno de estos, en el campamento m├ís cercano al carril central, detr├ís del campamento de las Harp├¡as del Medio en el lado de la Furia Dorada. Se activa a los 12 minutos de juego y tiene un tiempo de recarga de 5 minutos. Cada vez que un equipo capture con ├®xito el Faro Estigio, todas las estructuras que se puedan da├▒ar recibir├ín una gran cantidad de da├▒o que se acumula hasta 3 veces, independientemente de qu├® equipo lo haya capturado.\r\n          Primera captura: 500 de da├▒o\r\n          Segunda captura: 700 de da├▒o\r\n          Tercera captura: 900 de da├▒o\r\n\r\nTeleportadores: Hay dos de estos, uno al otro lado del carril largo, detr├ís del campamento de la Furia Dorada, y otro al otro lado del carril corto detr├ís del campamento del Gigante de Fuego. Se activan a los 8 minutos de juego, y para teletransportarse de un lado del mapa al otro, los jugadores deben estar en la plataforma del teletransportador durante 4.5s. Despu├®s de 4.5s, todos los jugadores (incluso los jugadores enemigos) que est├®n de pie en ella se teletransportar├ín, pero no podr├ín teletransportarse nuevamente durante 2 minutos (120 segundos).
